import React from 'react';
import { FaBlackTie } from 'react-icons/fa';

const stylling={
    color:black
};
function Home() {
  return (
    <div className='home' style={styling}>
        <p>
            Hello
        </p>
      <h1>Home</h1>
    </div>
  );
}

export default Home;
